import './App.css';

function App() {
  return (
    <div classNameName="page">
      <header className="header">
        <div className='header__container'>
          <img className="header__image" alt="Логотип ЗВСтрой" src="../images/main.png"/>
          <h2 className='header__title'>ЗВСРОЙ</h2> 
          <img className="header__logo" alt="Логотип Россия" src="../images/россия.svg"/>

          <div className="header__contacts">
          <a href="tel: +89054723415">+7 (905) 4723415</a>
          <a href="mailto: example@mail.ru">example@mail.ru</a>
          </div>
        </div>
      </header>

    </div>
  );
}

export default App;
